INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (24015, 0.0, "2030/12/17 14:59:59", 0.0, "2019/07/31 12:00:00", 24, 0.0, 1, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "カオリ（サマー）", 4, 4, 110501, 10021);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (24016, 0.0, "2030/12/17 14:59:59", 0.0, "2019/07/31 12:00:00", 24, 4.0, 2, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "カオリ（サマー）", 4, 1, 110501, 10021);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (24017, 0.0, "2030/12/17 14:59:59", 0.0, "2019/07/31 12:00:00", 24, 0.0, 3, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "カオリ（サマー）", 4, 4, 110501, 10021);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (24018, 0.0, "2030/12/17 14:59:59", 0.0, "2019/07/31 12:00:00", 24, 5.2, 4, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "カオリ（サマー）", 1, 2, 110501, 10021);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (24019, 0.0, "2030/12/17 14:59:59", 0.0, "2019/07/31 12:00:00", 24, 4.2, 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "カオリ（サマー）", 5, 6, 110501, 10021);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (24020, 0.0, "2030/12/17 14:59:59", 0.0, "2019/07/31 12:00:00", 24, 0.0, 6, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "カオリ（サマー）", 2, 2, 110501, 10021);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (24021, 0.0, "2030/12/17 14:59:59", 0.0, "2019/07/31 12:00:00", 24, 6.4, 7, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "カオリ（サマー）", 1, 6, 110501, 10021);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (24022, 0.0, "2030/12/17 14:59:59", 0.0, "2019/07/31 12:00:00", 24, 0.0, 8, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "カオリ（サマー）", 2, 2, 110501, 10021);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (24023, 0.0, "2030/12/17 14:59:59", 0.0, "2019/07/31 12:00:00", 24, 10.08, 9, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "カオリ（サマー）", 6, 3, 110501, 10021);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (24024, 0.0, "2030/12/17 14:59:59", 0.0, "2019/07/31 12:00:00", 24, 5.0, 10, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "カオリ（サマー）", 1, 2, 110501, 10021);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (24025, 0.0, "2030/12/17 14:59:59", 0.0, "2019/07/31 12:00:00", 24, 0.0, 11, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "カオリ（サマー）", 2, 2, 110501, 10021);
